import './BlueButton.css';
import React from 'react';

function BlueButton ({name = 'click me'}){
    return(
        <div>
            {<><h1>{props.header}</h1><h2>{props.head2}</h2><button> {props.name} </button></>}

            <button>{name}</button>
            
            
            </div>
        
    )
};

BlueButton.propTypes ={
name: PropTypes.string
};


export default BlueButton;
